DROP TABLE tCyclist
CREATE TABLE tCyclist (
    cyclistID INT NOT NULL PRIMARY KEY IDENTITY(1,1),
    fullName VARCHAR(100) NOT NULL,
    dob DATE NOT NULL,
    gender CHAR(1) NULL
		CONSTRAINT checkCyclistGender
		CHECK(gender = 'M' OR gender = 'F'),
    cyclistLevel CHAR(1) NOT NULL DEFAULT('B')
			CONSTRAINT checkCyClistLevel
			CHECK(cyclistLevel = 'B' OR cyclistLevel = 'I' OR cyclistLevel = 'A' ),
    streetAddress VARCHAR(255) NULL,
    postcode VARCHAR(10) NULL,
    county_city VARCHAR(50) NULL,
    country VARCHAR(50) NULL,
    contactNo VARCHAR(20) NULL,
    email VARCHAR(255) NULL,
	club INT NULL 
			REFERENCES tClub(clubID),
	isGroupLeader CHAR(1) NULL
			CONSTRAINT isCyclistAGroupLeader
			CHECK(isGroupLeader = 'Y' OR isGroupLeader = 'N')
);
